ミューズ 石鹸 3個パック<br>ブランド：ミューズ<br>販売・製造元：アース製薬<br><br>バイ菌から家族を守る薬用石鹸です。<br>ゆたかできめ細かい泡だちとすっきりした洗い上がりが特徴。<br>すみずみまで効果がゆきわたります。<br>全身の洗浄はもちろん、外出先から戻ったときの手洗いにもおすすめです。<br>医薬部外品。<br>  <br><br><br>使用方法<br>●適量を水かぬるま湯で泡だてて使い、その後よくすすいでください。<br> ご注意<br>●傷、湿疹、皮フ炎(かぶれ・ただれ)等の皮フ障害があるときは、悪化させるおそれがありますので、使用しないでください。<br>●使用中にかぶれたり、刺激等の異常を感じたりしたときには、使用を中止してください。<br>症状が残る場合は専門医に相談してください。<br> <br>成分<br>有効成分：トリクロカルバンその他の成分：無水クエン酸、パーム核油脂肪酸、エデト酸塩、酸化チタン、赤色201号、黄色203号、香料、精製水、せっけん用素地<br> 原産国マレーシア <br><br>お問い合わせ先<br>レキットベンキーザー・ジャパン株式会社お客様相談室/03-5439-0031 ノロウイルス(ノロウィルス)対策(薬用石鹸)とはノロウイルス(ノロウィルス)対策(薬用石鹸)とは、手指の洗浄にご使用いただけるノロウイルス(ノロウィルス)対策用の石鹸です。<br>ノロウイルスは流水による15秒間のすすぎのみでも、ウイルスが、1/100程度に減少します。<br>また、石けんによるもみ洗い60秒、または、「石けんによるもみ洗い10秒+流水すすぎ15秒」を2回が有効です。<br>薬用石鹸を用いて手を洗った後に15秒間流水ですすぎを行なった場合、トリクロサン、フェノール誘導体(イソプロピルメチルフェノール等)の成分において、感染力、ウイルス量ともに、流水すすぎのさらに1/10程度に減少します。<br>ヨード化合物では、ウイルス量はかわりませんが、感染力は1/10程度に減少します。<br>ノロウイルス(ノロウィルス)対策全部とはノロウイルス(ノロウィルス)の感染の予防に役立つ商品です。<br>予防のポイント・牡蠣などの二枚貝を十分に加熱調理してください。<br>牡蠣などでは中心部が85度1分間以上に加熱すれば、感染性がなくなります。<br>・調理従事者・介助等職員では、手洗いの徹底が有効です。<br>ノロウイルスはアルコールなどの消毒では十分な効果が期待できないため、石けんと水の力で洗い流すことが重要になります。<br>・調理器具などは0.02%の次亜塩素酸ナトリウム、または温湯で85度1分以上の加熱をして消毒を行います。<br>・感染者の嘔吐物や糞便にはノロウイルスが含まれています。<br>これらを処理する場合はペーパータオル等で取り除き、ビニール袋などに密封して捨ててください。<br>0.1%の次亜塩素酸ナトリウムで汚染場所(広めに)を消毒します。<br>その際、処理する人が感染しないよう、使い捨て手袋、マスク、エプロンを着用して処理を行い、処理後は十分に手を洗ってください。<br><br>日用品／洗面・バス用品／石鹸／石鹸全部<br>JANコード： 4906156800012<br><br>CS：40<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
